import { NavLink, Link } from 'react-router-dom';
export default function Home() {
    return (
        <div>
            <h2>
                <code>React Router 6</code>
            </h2>
            <h2>Home</h2>
            <NavLink to="/filter" className='nav-link'>Go to About</NavLink>
            <NavLink to="/filter" className='nav-link'>Go to Filter</NavLink>
        </div>
    )
}
